import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import HomeScreen from './Screens/HomeScreen';
function App() {

  return (
    <Switch>

       <Header/>

       <Container>
       {/* <HomeScreen/> */}

       <Route path="/" component={HomeScreen} exact></Route>
       {/* <Route path='/' component={HomeScreen} exact /> */}

       </Container>
       <Footer/> 

    </Switch>
  ); 
}

export default App;
